const imgInsightAnalytics = require("../images/drilldown_client-thumb.png");
const imgCRB = require("../images/crb-img.png");
const imgAlphaCap = require("../images/alphaCapture.png");
const imgAlerting = require("../images/alerting.png");

const portfolioData = [
  {
    id: 1,
    img: imgInsightAnalytics,
    title: "Insight Analytics",
    subtitle: "A Client Data Dashboard"
  },
  {
    id: 2,
    img: imgAlphaCap,
    title: "Alpha Capture",
    subtitle: "A Trade Idea Tracker"
  },
  {
    id: 3,
    img: imgCRB,
    title: "CRB Pricer",
    subtitle: "Central Risk Book Pricing and Trade Execution"
  },
  {
    id: 4,
    img: imgAlerting,
    title: "Alerting",
    subtitle: "Client and Ticker Alerts for Traders"
  }
];

export default portfolioData;
